Wasm doesn't support threads yet (but experimental work is ongoing ), so attempts to spawn threads in wasm will panic. You can use #[cfg(..)]s to enable threaded and non-threaded code paths depending on if the target is WebAssembly or not: #![cfg(target_arch = "wasm32")]
fn do_work() { // Do work with only this thread...
} #![cfg(not(target_arch = "wasm32"))]
fn do_work() { use std::thread; // Spread work to helper threads.... thread::spawn(|| { // ... });
} Another option is to factor out thread spawning from your library and allow users to "bring their own threads" similar to factoring out file I/O and allowing users to bring their own I/O. This has the side effect of playing nice with applications that want to own their own custom thread pool.

