직전 챕터에서 초기 프로젝트 템플릿을 클론했는데, 이 템플릿을 수정해보도록 합시다. alert를 임포트하는 줄과 greet 함수를 wasm-game-of-life/src/lib.rs 파일에서 지워보고, 세포의 타입 정의를 대신 추가해 주는 것으로 시작해보겠습니다: #[wasm_bindgen]
#[repr(u8)]
#[derive(Clone, Copy, Debug, PartialEq, Eq)]
pub enum Cell { Dead = 0, Alive = 1,
} 각 세포가 1 byte 사이즈로 표현되도록 해야하기 때문에 #[repr(u8)]을 잊지 않고 붙여주도록 하고, 세포 주변에 살아있는 이웃들을 쉽게 셀수 있도록, 0를 Dead로, 1을 Alive로 정해주는 것도 중요합니다. 그 다음, 세상을 정의해봅시다. 세상을 나타내는 구조체는 너비와 높이, 세포들을 나타내는 width * height 길이의 벡터(vector)를 필드로 가지게 됩니다. #[wasm_bindgen]
pub struct Universe { width: u32, height: u32, cells: Vec<Cell>,
} 이전에 설명한 내용대로 주어진 행과 열을 세포 벡터의 인덱스로 변환하여 사용할수 있습니다: impl Universe { fn get_index(&self, row: u32, column: u32) -> usize { (row * self.width + column) as usize } // ...
} 세포의 다음 상태를 계산하려면 몇 개의 이웃이 살아있는지 확인해야 합니다. 이 내용을 토대로 live_neighbor_count 메소드를 작성해봅시다! impl Universe { // ... fn live_neighbor_count(&self, row: u32, column: u32) -> u8 { let mut count = 0; for delta_row in [self.height - 1, 0, 1].iter().cloned() { for delta_col in [self.width - 1, 0, 1].iter().cloned() { if delta_row == 0 && delta_col == 0 { continue; } let neighbor_row = (row + delta_row) % self.height; let neighbor_col = (column + delta_col) % self.width; let idx = self.get_index(neighbor_row, neighbor_col); count += self.cells[idx] as u8; } } count }
} live_neighbor_count 메소드는 델타값과 나머지 값을 확인해서 세상의 끝에서 발생할 수 있는 예외를 if문으로 처리합니다. -1의 델타를 적용할 때, self.height -1을 추가해서 1을 빼는 대신 나머지 값을 계속 처리하게 합니다. row와 column은 0이 될수 있고, 이 값에서 1을 뺄려고 할때, unsigned integer underflow가 발생하게 됩니다. 이제 현재 세대를 기반으로 다음 세대를 처리하는데 필요한 준비가 완료됐습니다! match 문을 사용해서 보기 명확하게 게임의 규칙을 나타내봅시다. 추가로, 틱이 일어날 때 JavaScript가 컨트롤하도록 할 것이기 때문에, #[wasm_bindgen] 블럭을 추가해서 이 메소드를 JavaScript 코드에 노출시켜보도록 하겠습니다. /// Public 메소드, JavaScript로 익스포트 할수 있게 함.
#[wasm_bindgen]
impl Universe { pub fn tick(&mut self) { let mut next = self.cells.clone(); for row in 0..self.height { for col in 0..self.width { let idx = self.get_index(row, col); let cell = self.cells[idx]; let live_neighbors = self.live_neighbor_count(row, col); let next_cell = match (cell, live_neighbors) { // 규칙 1: 인구 부족으로 2개 미만의 이웃을 가진 세포는 죽게 됩니다. (Cell::Alive, x) if x < 2 => Cell::Dead, // 규칙 2: 2개 혹은 3개의 이웃을 가진 세포는 다음 세대에서 계속 살아있습니다. (Cell::Alive, 2) | (Cell::Alive, 3) => Cell::Alive, // Rule 3: 과잉 인구로 3개 초과의 이웃을 가진 모든 세포는 죽게 됩니다. (Cell::Alive, x) if x > 3 => Cell::Dead, // 규칙 4: 세포 증식으로 정확히 3개의 이웃을 가진 세포는 살아나게 됩니다. (Cell::Dead, 3) => Cell::Alive, // 규칙이 적용되지 않는 세포들의 상태는 그대로 유지되게 됩니다. (otherwise, _) => otherwise, }; next[idx] = next_cell; } } self.cells = next; } // ...
} 지금까지는 세상의 상태를 세포들의 벡터로 표시했습니다. 조금 더 사람이 읽기 쉽도록 텍스트 렌더러 (text renderer)를 구현해보도록 합시다. 세상을 한줄 한줄씩 텍스트로 표현을 해보는데, 살아있는 세포들을 유니코드 문자 ◼ ("black medium square")로 나타내고 죽은 세포들을 ◻ ("white medium square")로 표현하겠습니다. Rust 스탠다드 라이브러리의 Display 트레이트를 구현해서 사람이 읽기 쉬운 방식으로 포맷할수 있도록 메소드를 추가해봅시다. 이 트레이트를 구현하면 자동적으로 Universe의 인스턴스(instance)들이 to_string 메소드를 사용할수 있게 됩니다. use std::fmt; impl fmt::Display for Universe { fn fmt(&self, f: &mut fmt::Formatter) -> fmt::Result { for line in self.cells.as_slice().chunks(self.width as usize) { for &cell in line { let symbol = if cell == Cell::Dead { '◻' } else { '◼' }; write!(f, "{}", symbol)?; } write!(f, "\n")?; } Ok(()) }
} 마침내, render 메소드와 함께 생성자를 정의해서 세포들이 살아나고 죽어가는 신기한 세상을 생성할 수 있도록 해보겠습니다. /// Public 메소드, JavaScript로 익스포트 할수 있게 함.
#[wasm_bindgen]
impl Universe { // ... pub fn new() -> Universe { let width = 64; let height = 64; let cells = (0..width * height) .map(|i| { if i % 2 == 0 || i % 7 == 0 { Cell::Alive } else { Cell::Dead } }) .collect(); Universe { width, height, cells, } } pub fn render(&self) -> String { self.to_string() }
} 드디어 Game of Life의 Rust 코드 구현이 끝났습니다! 이제 wasm-game-of-life 디렉토리에서 wasm-pack build를 실행하여 WebAssembly 파일을 다시 컴파일 해주세요.

