wasm-game-of-life/www/index.html에 <pre> 요소를 추가해서 세상을 렌더링 해봅시다. <pre> 요소를 <script> 태그 바로 위에 추가해주세요: <body> <pre id="game-of-life-canvas"></pre> <script src="./bootstrap.js"></script>
</body> 추가로, <pre> 가 웹사이트 중간에 표시될수 있도록 CSS flex box를 사용해봅시다. wasm-game-of-life/www/index.html 파일을 열고 <head> 내에 <style> 태그를 추가해주세요: <style> body { position: absolute; top: 0; left: 0; width: 100%; height: 100%; display: flex; flex-direction: column; align-items: center; justify-content: center; }
</style> 이제 wasm-game-of-life/www/index.js 파일 최상단에 기존 greet 함수를 지우고 Universe를 임포트하는 줄을 추가해주세요. import { Universe } from "wasm-game-of-life"; <pre> 요소를 pre 상수에 담은 다음 새 우주를 시작해봅시다. const pre = document.getElementById("game-of-life-canvas");
const universe = Universe.new(); 이 JavaScript 함수는 requestAnimationFrame 루프 로 실행해서 매 반복마다 업데이트된 세상을 <pre>에 반영하고 Universe::tick을 호출합니다. const renderLoop = () => { pre.textContent = universe.render(); universe.tick(); requestAnimationFrame(renderLoop);
