web-sys 크레이트를 사용하여 console.log 함수를 사용하고, 매 세포들의 정보를 로그 할수 있도록 기능을 추가해봅시다. 우선, wasm-game-of-life/Cargo.toml파일을 열고 web-sys를 종속성으로 추가한 다음 "console" 기능을 활성해주세요: [dependencies] # ... [dependencies.web-sys]
version = "0.3"
features = [ "console",
] 개발자 경험을 위해 console.log 함수를 println! 스타일의 매크로로 만들어(wrap)보겠습니다: extern crate web_sys; // `println!(...)` 스타일의 문법을 `console.log`에 사용할수 있게 해주는 매크로.
macro_rules! log { ( $( $t:tt )* ) => { web_sys::console::log_1(&format!( $( $t )* ).into()); }
} 이제 Rust 코드에 log 매크로 호출을 추가해서 콘솔에 메세지를 로그해봅시다. 예를 들어서, 세포의 상태, 이웃 수, 다음 상태를 로그할수 있도록 wasm-game-of-life/src/lib.rs 수정해주세요: diff --git a/src/lib.rs b/src/lib.rs
index f757641..a30e107 100755
--- a/src/lib.rs
+++ b/src/lib.rs
@@ -123,6 +122,14 @@ impl Universe { let cell = self.cells[idx]; let live_neighbors = self.live_neighbor_count(row, col); + log!(
+ "cell[{}, {}] is initially {:?} and has {} live neighbors",
+ row,
+ col,
+ cell,
+ live_neighbors
+ );
+ let next_cell = match (cell, live_neighbors) { // 규칙 1: 인구 부족으로 2개 미만의 이웃을 가진 세포는 죽게 됩니다. @@ -140,6 +147,8 @@ impl Universe { (otherwise, _) => otherwise, }; + log!(" it becomes {:?}", next_cell);
+ next[idx] = next_cell; } }

