게임을 일시정지 시킬수 있도록 버튼을 하나 만들어 봅시다. wasm-game-of-life/www/index.html 파일 내의 <canvas> 바로 위에 버튼을 추가해주세요: <button id="play-pause"></button> wasm-game-of-life/www/index.js JavaScript 파일에서 다음 변경사항들을 적용해보겠습니다: cancelAnimationFrame 인자로 보내는 식별자(identifier)에 해당하는 애니메이션을 취소시킬수 있도록 제일 최근에 호출한 requestAnimationFrame 함수가 반환하는 식별자를 추적합니다. 재생/일시정지 버튼을 눌렀을 때, 대기 중인 애니메이션 프레임의 식별자를 가지고 있는지 확인합니다. 가지고 있다면 게임이 실행중이라는 의미이므로 renderLoop가 다시 호출되지 않도록 애니메이션을 일시정지 시킵니다. 식별자를 찾지 못했다면 게임이 멈춰있다는 의미이므로 requestAnimationFrame 함수를 사용하여 게임을 다시 시작해주도록 합니다. 이 작업은 JavaScript로 해야 하기 때문에 따로 Rust 소스 코드를 수정하지 않아도 됩니다. animationId 변수를 추가하여 requestAnimationFrame 함수가 반환하는 식별자를 추적해봅시다. 대기 중인 애니메이션이 없다면, 이 값을 null로 설정해주겠습니다. let animationId = null; // `requestAnimationFrame`의 반환값이 `animationId`에 할당되는
// 부분 외에는 기존과 동일한 함수입니다.
const renderLoop = () => { drawGrid(); drawCells(); universe.tick(); animationId = requestAnimationFrame(renderLoop);
}; 언제든 animationId의 값을 확인해서 게임이 멈춰있는지 확인할 수 있습니다: const isPaused = () => { return animationId === null;
}; 이제 재생/일시정지 버튼일 클릭 됐을 때 게임의 재생 여부를 확인할 수 있고, 마찬가지로 renderLoop 애니메이션을 다시 시작하거나 일시정지 할수도 있습니다. 추가로, 버튼이 수행하는 동작을 반영하여 버튼의 텍스트 아이콘을 업데이트 해주도록 하겠습니다. const playPauseButton = document.getElementById("play-pause"); const play = () => { playPauseButton.textContent = "⏸"; renderLoop();
}; const pause = () => { playPauseButton.textContent = "▶"; cancelAnimationFrame(animationId); animationId = null;
}; playPauseButton.addEventListener("click", event => { if (isPaused()) { play(); } else { pause(); }
}); 마지막으로, 추가한 버튼이 올바른 초기 텍스트 아이콘을 가질수 있도록 이전에 requestAnimationFrame(renderLoop)을 직접 불러서 빠르게 시작했던 부분을 play 함수를 대신 호출하여 시작하도록 바꿔주겠습니다. // 기존에는 `requestAnimationFrame(renderLoop)`를 호출하는 줄이었습니다.
play(); http://localhost:8080/ 페이지를 새로고침하면 게임을 일시정지하고 다시 시작할수 있도록 버튼이 추가된 부분을 확인할 수 있습니다!

