이제 게임을 일시정지 할수 있게 됐으니 세포들을 클릭해서 상태를 바꿔볼수 있도록 해봅시다. 클릭할 때 세포의 생존 여부를 전환할 수 있도록 코드를 작성해보겠습니다. toggle 메소드를 wasm-game-of-life/src/lib.rs 파일 내의 Cell에 추가해주겠습니다. impl Cell { fn toggle(&mut self) { *self = match *self { Cell::Dead => Cell::Alive, Cell::Alive => Cell::Dead, }; }
} 주어진 행과 열에 위치한 세포의 상태를 전환(toggle)할수 있도록, 행과 열을 인덱스로 변환(translate)하고, 그 다음에 변환한 인덱스를 세포 벡터로 전환하겠습니다. 그 다음 변환된 인덱스에 위치하는 세포를 전환할수 있도록 메소드를 호출하겠습니다: /// Public 메소드, JavaScript로 익스포트 할수 있게 함.
#[wasm_bindgen]
impl Universe { // ... pub fn toggle_cell(&mut self, row: u32, column: u32) { let idx = self.get_index(row, column); self.cells[idx].toggle(); }
} 이 impl 블럭 내에 정의된 메소드는 JavaScript 코드에서 부를수 있도록 #[wasm_bindgen] 속성과 함께 정의됐습니다. wasm-game-of-life/www/index.js 파일에서 <canvas> 요소의 클릭 이벤트를 수신(listening)하고 페이지의 상대 좌표(page-relative coordinates)를 캔버스 상대 좌표(canvas-relative coordinates)로 변환한 다음 toggle_cell 메소드를 호출해보고 마지막으로는 장면을 다시 그려보겠습니다. canvas.addEventListener("click", event => { const boundingRect = canvas.getBoundingClientRect(); const scaleX = canvas.width / boundingRect.width; const scaleY = canvas.height / boundingRect.height; const canvasLeft = (event.clientX - boundingRect.left) * scaleX; const canvasTop = (event.clientY - boundingRect.top) * scaleY; const row = Math.min(Math.floor(canvasTop / (CELL_SIZE + 1)), height - 1); const col = Math.min(Math.floor(canvasLeft / (CELL_SIZE + 1)), width - 1); universe.toggle_cell(row, col); drawGrid(); drawCells();
}); wasm-game-of-life 디렉토리에서 wasm-pack build 명령어를 실행하여 다시 빌드한 다음, http://localhost:8080/ 페이지를 새로고침해보세요. 이제 세포를 클릭해서 상태를 전환할수 있게 됐습니다. 한번 패턴을 직접 그려보세요!

