이 FPS 타이머는 구현한 게임의 렌더링 속도를 어떻게 개선하는지 살펴볼 때 매우 유용하게 사용될 예정입니다. wasm-game-of-life/www/index.js 파일에 fps 객체를 추가하는 것으로 시작해봅시다: const fps = new class { constructor() { this.fps = document.getElementById("fps"); this.frames = []; this.lastFrameTimeStamp = performance.now(); } render() { // 마지막 프레임 렌더부터의 델타 시간을 fps 단위로 변환합니다. const now = performance.now(); const delta = now - this.lastFrameTimeStamp; this.lastFrameTimeStamp = now; const fps = 1 / delta * 1000; // 마지막 100개의 타이밍만 저장합니다. this.frames.push(fps); if (this.frames.length > 100) { this.frames.shift(); } // 최대, 최소 타이밍과 마지막 100개 타이밍의 평균을 찾습니다. let min = Infinity; let max = -Infinity; let sum = 0; for (let i = 0; i < this.frames.length; i++) { sum += this.frames[i]; min = Math.min(this.frames[i], min); max = Math.max(this.frames[i], max); } let mean = sum / this.frames.length; // 통계를 렌더합니다. this.fps.textContent = `
Frames per Second: latest = ${Math.round(fps)}
avg of last 100 = ${Math.round(mean)}
min of last 100 = ${Math.round(min)}
max of last 100 = ${Math.round(max)}
`.trim(); }
}; fps 객체의 render 함수를 매 renderLoop 반복마다 불러보겠습니다: const renderLoop = () => { fps.render(); //new universe.tick(); drawGrid(); drawCells(); animationId = requestAnimationFrame(renderLoop);
}; 마지막으로, fps 요소를 잊지 말고 wasm-game-of-life/www/index.html 파일에 추가해줍시다. <canvas> 바로 위에 추가해주세요: <div id="fps"></div> 그리고 CSS 프로퍼티를 추가해서 깔끔하게 포맷해주겠습니다: #fps { white-space: pre; font-family: monospace;
} 짜잔! 이제 http://localhost:8080 페이지를 새로고침 하면 FPS 카운터를 확인할 수 있게 됐습니다!

