각 Universe::tick이 호출되는데 시간이 얼마나 걸리는지 확인해볼려면 web-sys 크레이트의 console.time, console.timeend 를 활용해볼수 있습니다. 먼저, wasm-game-of-life/Cargo.toml 파일을 열고 web-sys 를 종속성으로 추가해주세요: [dependencies.web-sys]
version = "0.3"
features = [ "console",
] console.time를 호출할 때 마다 console.timeEnd도 같이 호출될 예정이기 때문에, RAII 타입으로 묶어서 간편하게 사용할수도 있습니다: extern crate web_sys;
use web_sys::console; pub struct Timer<'a> { name: &'a str,
} impl<'a> Timer<'a> { pub fn new(name: &'a str) -> Timer<'a> { console::time_with_label(name); Timer { name } }
} impl<'a> Drop for Timer<'a> { fn drop(&mut self) { console::time_end_with_label(self.name); }
} 그 다음에, 메소드 최상단에 이 코드를 추가해서 얼마나 각 Universe::tick 호출이 오래 걸리는지 측정해볼수 있습니다: let _timer = Timer::new("Universe::tick"); 콘솔에 Universe::tick를 호출하는데 얼마나 오래 걸렸는지 로그를 표시합니다: console.time 로그 스크린샷 추가로, 브라우저 프로파일러(profiler)의 timeline 혹은 waterfall 뷰에서 console.time과 console.timeEnd가 같이 실행된 부분을 확인할 수 있습니다: console.time 로그 스크린샷

