⚠️ 이 섹션은 FireFox의 스크린샷을 예시로 보여줍니다. 거의 모든 모던 브라우저가 비슷한 기능들을 가지고 있지만, 개발자 도구에 브라우저마다 약간의 차이가 있을 수 있습니다. 추출하게 될 프로파일 정보는 기본적으로 같지만, 보게 될 뷰나 도구 이름 등이 다를수 있는 점을 확인해주세요. 구현한 Game of Life 세상을 더 크게 만들어보면 어떨까요? 64 x 64 사이즈의 세상을 128 x 128 사이즈로 늘려봅시다. (wasm-game-of-life/src/lib.rs 파일에서 Universe::new를 수정해주세요.) 제 컴퓨터에서는 사이즈를 이렇게 늘리게 되면 부드럽게 작동하던 60fps 화면이 버벅이면서 40fps 처럼 보이는 것 같습니다. 프로파일을 기록하고 waterfall 뷰를 확인하면, 각 애니메이션이 20 밀리초 이상 걸리는 것을 확인할 수 있습니다. 60fps로 작동했을 때 프레임 전체를 렌더하는데 16 밀리초가 걸린 것을 떠올려보면 확실히 차이가 있습니다. 참고로, JavaScript와 WebAssembly외에도 페이지를 그리는 등 브라우저가 수행하는 작업의 영향도 있습니다. 페이지 렌더링 처리의 waterfall 뷰 스크린샷 한 애니메이션 프레임동안 어떤 일이 일어나는지 확인해보면, CanvasRenderingContext2D.fillStyle setter가 성능 차원에서 많은 비용을 요구하는 것을 확인할 수 있습니다. ⚠️ FireFox 브라우저에서 위에서 언급된 CanvasRenderingContext2D.fillStyle 대신에 "DOM"이 표시된다면, 성능 개발자 도구 (performance developer tools) 에서 "Gecko 플랫폼 데이터 표시하기 (Show Gecko Platform Data)" 옵션을 활성화해줘야 합니다: "Gecko 플랫폼 데이터 표시하기 (Show Gecko Platform Data)" 옵션 활성화하기 페이지 렌더링 처리의 flamegraph 뷰 스크린샷 많이 표시되는 호출 트리의 집계 (call tree's aggregation) 를 살펴보면 이게 전혀 이상한 동작이 아님을 확인할 수 있습니다: 페이지 렌더링 처리의 flamegraph 뷰 스크린샷 거의 40% 분량을 이 setter에 사용해버렸네요! ⚡ tick 메소드가 성능 병목을 일으키는데 특별한 이유가 있을 것 같았지만, 사실 그렇지 않은 부분을 확인했습니다. 작업을 하다 보면 예상치 못한 부분에서 시간을 많이 쓰게 될수도 있으니, 항상 정말 중요한 프로파일링 도구를 먼저 살펴보도록 합시다. wasm-game-of-life/www/index.js 파일 내의 drawCells 함수에서 fillStyle 프로퍼티가 한번 정해지고 세상 내의 모든 세포와 모든 애니메이션에 이 프로퍼티가 사용되게 됩니다. for (let row = 0; row < height; row++) { for (let col = 0; col < width; col++) { const idx = getIndex(row, col); ctx.fillStyle = cells[idx] === DEAD ? DEAD_COLOR : ALIVE_COLOR; ctx.fillRect( col * (CELL_SIZE + 1) + 1, row * (CELL_SIZE + 1) + 1, CELL_SIZE, CELL_SIZE ); }
} fillStyle가 많은 성능을 요구하는 부분을 확인했는데, 대신에 어떤 식으로 코드를 작성해야 할까요? 세포의 생존 여부에 따라 fillStyle를 사용하도록 바꿔봅시다. fillStyle = ALIVE_COLOR를 적어줘서 살아있는 세포만 그리게 하고 fillStyle = DEAD_COLOR를 적어줘서 죽은 세포도 동일한 방식으로 처리를 해준다면, 세포들을 모두 한번에 그리지 않고 fillStyle을 두번만 설정할수 있게 됩니다. // 살아있는 세포 처리.
ctx.fillStyle = ALIVE_COLOR;
for (let row = 0; row < height; row++) { for (let col = 0; col < width; col++) { const idx = getIndex(row, col); if (cells[idx] !== Cell.Alive) { continue; } ctx.fillRect( col * (CELL_SIZE + 1) + 1, row * (CELL_SIZE + 1) + 1, CELL_SIZE, CELL_SIZE ); }
} // 죽어있는 세포 처리.
ctx.fillStyle = DEAD_COLOR;
for (let row = 0; row < height; row++) { for (let col = 0; col < width; col++) { const idx = getIndex(row, col); if (cells[idx] !== Cell.Dead) { continue; } ctx.fillRect( col * (CELL_SIZE + 1) + 1, row * (CELL_SIZE + 1) + 1, CELL_SIZE, CELL_SIZE ); }
} 코드 파일을 저장하고 http://localhost:8080/ 페이지를 새로고침 해주면, 웹사이트가 60fps로 다시 부드럽게 렌더링을 하는 것을 볼수 있습니다. 프로파일을 다시 확인해보면, 각 애니메이션 프레임마다 오직 10 밀리초만 걸리는 부분을 확인할 수 있습니다. drawCells 함수를 업데이트 한 이후 페이지 렌더링 처리의 waterfall 뷰 스크린샷 한 프레임을 다시 분석해보면, fillStyle 이 더이상 성능을 많이 사용하지 않고, fillRect가 각 세포 사각형을 그리는데 대부분의 시간을 사용하는 것을 확인할 수 있습니다. drawCells 함수를 업데이트 한 이후 페이지 렌더링 처리의 flamegraph 뷰 스크린샷

