어떤 사람들은 빨리 빨리 하는걸 더 좋아해서, 매 프레임마다 1틱이 아니라 9틱씩 넘어가는걸 선호하기도 합니다. wasm-game-of-life/www/index.js 파일의 renderLoop 함수를 수정해서 생각외로 쉽게 할수 있긴 합니다: for (let i = 0; i < 9; i++) { universe.tick();
} 제 컴퓨터에서는 이 코드가 35fps 속도로 다시 느려지는것 같습니다. 좋지 않은 현상이니 다시 60fps 로 만들어보겠습니다! Universe::tick 에서 시간이 많이 소요되는 것으로 보이므로, console.time과 console.timeEnd를 호출해서 래핑(wrapping)할수 있도록 Timer를 추가해보고 어떻게 되는지 살펴보겠습니다. 제 가설대로라면 매 틱마다 세포의 새 벡터를 할당하고 기존 벡터를 해제(freeing)하는 작업은 성능을 많이 사용하고 시간도 많이 소비하게 됩니다. pub fn tick(&mut self) { let _timer = Timer::new("Universe::tick"); let mut next = { let _timer = Timer::new("다음 세포들을 할당합니다."); self.cells.clone() }; { let _timer = Timer::new("다음 세대를 처리합니다."); for row in 0..self.height { for col in 0..self.width { let idx = self.get_index(row, col); let cell = self.cells[idx]; let live_neighbors = self.live_neighbor_count(row, col); let next_cell = match (cell, live_neighbors) { // 규칙 1: 인구 부족으로 2개 미만의 이웃을 가진 세포는 죽게 됩니다. (Cell::Alive, x) if x < 2 => Cell::Dead, // 규칙 2: 2개 혹은 3개의 이웃을 가진 세포는 다음 세대에서 계속 살아있습니다. (Cell::Alive, 2) | (Cell::Alive, 3) => Cell::Alive, // 규칙 3: 과잉 인구로 3개 초과의 이웃을 가진 모든 세포는 죽게 됩니다. (Cell::Alive, x) if x > 3 => Cell::Dead, // 규칙 4: 세포 증식으로 정확히 3개의 이웃을 가진 세포는 살아나게 됩니다. (Cell::Dead, 3) => Cell::Alive, // 규칙이 적용되지 않는 세포들의 상태는 그대로 유지되게 됩니다. (otherwise, _) => otherwise, }; next[idx] = next_cell; } } } let _timer = Timer::new("기존 세포들을 해제합니다."); self.cells = next;
} 브라우저 개발자 도구에서 타이밍(timing)을 확인해보면 이 가설이 사실은 명백하게 틀린 것을 알수 있습니다. 실제로는, 대부분의 시간이 다음 세대 세포들을 계산하는데 사용되게 됩니다. 그리고 매 틱마다 벡터 값을 할당하고 해제하는 작업이 놀랍게도 그렇게 성능이 많이 들지 않습니다. 다시 한번 정말 중요한 프로파일링을 해보겠습니다! Universe::tick 타이머 결과 값의 스크린샷 다음 섹션에서는 nightly 컴파일러가 필요합니다. 필요한 테스트 기능 게이트(test feature gate) 가 nightly 버전에 포함돼 있어서 그런데, 벤치마킹에 이 기능을 사용해보겠습니다. cargo benchcmp 이라는 툴도 필요하니 설치해주도록 합시다. cargo bench로 생성한 마이크로 벤치마크들(micro-benchmarks) 을 비교하는데 사용하는 작은 사이즈의 유틸리티입니다. WebAssembly랑 동일한 작업을 수행하는 네이티브 코드인 #[bench]를 작성해봅시다. 이렇게 작성하는 대신에 더 많은 기능을 사용할수 있게 됩니다. 이제 새롭게 작성된 wasm-game-of-life/benches/bench.rs을 확인해주세요: #![feature(test)] extern crate test;
extern crate wasm_game_of_life; #[bench]
fn universe_ticks(b: &mut test::Bencher) { let mut universe = wasm_game_of_life::Universe::new(); b.iter(|| { universe.tick(); });
} 그리고 #[wasm_bindgen] 속성을 모두 주석처리 해주도록 하고, Cargo.toml 파일의 "cdylib"도 주석처리 해주겠습니다. 이렇게 하지 않으면 빌드가 실패하고 링크 오류(link errors)가 발생하게 됩니다. 준비가 다 됐다면, cargo bench | tee before.txt 명령어를 실행해서 코드를 컴파일하고 벤치마크를 실행해봅시다. | tee before.txt를 포함하면서 cargo bench 명령어의 출력값을 가져와서 before.txt 파일에 저장하게 되니 이 부분도 확인해주세요. $ cargo bench | tee before.txt Finished release [optimized + debuginfo] target(s) in 0.0 secs Running target/release/deps/wasm_game_of_life-91574dfbe2b5a124 running 0 tests test result: ok. 0 passed; 0 failed; 0 ignored; 0 measured; 0 filtered out Running target/release/deps/bench-8474091a05cfa2d9 running 1 test
test universe_ticks ... bench: 664,421 ns/iter (+/- 51,926) test result: ok. 0 passed; 0 failed; 0 ignored; 1 measured; 0 filtered out 바이너리 파일의 위치도 같이 표시되는 부분을 확인할 수 있습니다. 이번에는 사용하는 운영체제(operating system)의 프로파일러를 사용하여 벤치마킹을 다시 해보겠습니다. 제 컴퓨터는 리눅스(Linux)를 사용하고 있으니 perf 를 예제로 사용해보겠습니다: $ perf record -g target/release/deps/bench-8474091a05cfa2d9 --bench
